import React, { Component } from 'react';
import BarCharts from './components/barCharts';
import axios from "axios";

class App extends Component {
    constructor(props){
        super(props);
        this.state = {neoData : {}}
    }

  render() {

      const neoApiData =
          axios.get('https://api.nasa.gov/neo/rest/v1/neo/browse?api_key=h2vuNpgOwi4P3bqUpqys0ANkIuHL1cebMn0jeWE5')
              .then(res => {
                  return res.data.near_earth_objects;
              });

      neoApiData.then(function (value) {
          let neoData = value;
      });

      console.log(neoData);

    return (
      <div>
        <h1>Hello Botify !</h1>
            <BarCharts neoData={this.state.neoData}/>
      </div>
    );
  }
}

export default App;
